import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Table, Button, Container, Modal, ModalBody, ModalHeader, FormGroup, ModalFooter}from 'reactstrap'


const data = [
{ id: 1, personaje: "juan diego", anime: "naruto"},
{ id: 2, personaje: "pepe", anime: "obe punchman"},
{ id: 3, personaje: "pepe chato", anime: " mushucu tensei"},
{ id: 4, personaje: "pablito", anime: "padres de familia"},
{ id: 5, personaje: "ven", anime: "dargonball"},
];


class App extends React.Component{
    state={
      data: data
    }
    render(){
  return (
  <>
      <Container>
      <br/>
      <Button color="primary">insertar nuevo personage</Button>
    <br/><br/>

      <Table>

        <thead><tr><th>Id</th>
        <th>personaje</th>
        <th>anime</th>
        <th>Acciones</th></tr></thead>
        <tbody>
          {this.state.data.map((elemanto)=>(
            <tr>
                <td>{elemanto.id}</td>
                <td>{elemanto.personaje}</td>
                <td>{elemanto.anime}</td>
                <td><Button color="primary">Modificar</Button>{" "}
                <Button color="danger">Eliminar</Button></td>
                </tr>
          ))}




        </tbody>


      </Table>

      </Container>

    </>

  );
}
}
  export default App;
